import React from "react";
import Heart from "./Heart";

const ImgCard = ({ foto, changeLiked }) => {
  return (
    <div
      className="foto"
      style={{ backgroundImage: `url(${foto.src.tiny})` }}
      onClick={() => changeLiked(foto)}
    >
        <Heart filled={foto.liked} />
    </div>
  );
};

export default ImgCard;
